const getDataFromApi = () => {
  fetch(
    "https://quotes-inspirational-quotes-motivational-quotes.p.rapidapi.com/quote"
  )
    .then((response) => response.json())
    .then((data) => {
      console.log(data);
    });
};

export default {
  getDataFromApi: getDataFromApi,
};
